import React from 'react';
import Menu from "./Menu";

const TopBar = () => {
    return (
        <div className='toolbar-container'>
          <div className="indices-container">
            <div className='nifty'>
              <p></p>
            </div>
          </div>
        </div>
      );
}

export default TopBar;
